// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "../../token/ERC721/ERC721.sol";
import "../../utils/Counters.sol";

/**
 * @title NFT representing a share of a finance product (term deposit, crowdunfing, investment etc.)
 * @author AshtonIzmev
 */
contract FP is ERC721 {

    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;

    // 0 is DAT (term deposit)
    // 1 is Crowdfunding
    // 2 is Mudaraba
    // Not using enum because list may grow (is there a better way ?)
    mapping (uint256 => uint16) private _subscriptionKinds;

    address public creator;

    modifier onlyCreator() { 
        require(_msgSender() == creator, "Only the creator is allowed to call this");
        _;
    }

    constructor(string memory name_, string memory symbol_) 
        ERC721(name_, symbol_) {
            creator = _msgSender();
    }

    function _baseURI() internal virtual view override returns (string memory) {
        return "https://curieux.ma/";
    }

    function getKind(uint256 tokenId) public virtual view returns (uint16) {
        return _subscriptionKinds[tokenId];
    }

    function create(address buyer, uint16 kind_) 
        public virtual onlyCreator returns (uint256) {
        _tokenIds.increment();
        _safeMint(buyer, _tokenIds.current());
        _subscriptionKinds[_tokenIds.current()] = kind_;
        return _tokenIds.current();
    }

    function destroy(uint256 tokenId) public virtual onlyCreator {
        _burn(tokenId);
    }

}
